import * as React from 'react'
import './pageFour.css'
import Title from './components/title_bar'
import Navbar from './components/nav_bar'


export default function Events(){

    let DefaultLang:string;

    let StoreLang:any = localStorage.getItem('LangSel');

    if (StoreLang === 'DE') {

    DefaultLang = 'DE'

    } else  {

     DefaultLang='EN'

    } 

    const [Lang,SetLang]=React.useState(DefaultLang)

    let LangEN,LangDE;

    if(Lang === 'EN'){
        LangEN = 'block'
        LangDE = 'none'
    } else if (Lang === 'DE'){
        LangDE='block'
        LangEN='none'       
    }



    return(
        <div>
            <Title/>
            <Navbar onUpdate={(value:string)=>SetLang(value)} pg_Events='4px solid red' />

            <div className = 'txt_box'>
                <h1 style={{display:LangEN}}>Events calender</h1>
                <h1 style={{display:LangDE}}>Terminkalender</h1>

                <hr className='hr_a'></hr>

            </div>


        </div>
    )
}
